export default function SelectL({ func, names }) {
  return (
    <div className="select">
      <select className="select__list" onChange={(event) => func(event.target.value, event.target.selectedIndex)}>
        {
            names.map((element) => (
              <option className="select__list-item" key={element.id} value={element.currencySymbol} id={element.rateUsd}>
                {element.id}
                {' '}
                {element.symbol}
              </option>
            ))
          }
      </select>
    </div>
  );
}
